import React from 'react';

const App = () => {
	return (
		<div class="wrapper h-card">
		<a href="https://reactjs.org/" target="_blank">
      <h4 style="position:fixed;top:40px;left:40px;z-index:1000;color:#FB544D;font-size:15px">Built in React JS!</h4>
    </a>
			<div>Hello</div>
		</div>
	);
}

export default App;
